import { Col, Label, Row } from "reactstrap";

export default function BlankRowTable({margin }) {
    return <div className="content">
        <Row>
            <Col md="12">
                <Label style={{ marginTop: margin }}></Label>
            </Col>
        </Row>
    </div>
}
